import React from 'react';
import './Home.css'; // Import CSS tùy chỉnh cho trang Home

const Home = () => {
  return (
    <div className="home-container">
      <div className="column column-left">
        <div className="row">
          <h2>CÔNG TY CỔ PHẦN TẬP ĐOÀN THƯƠNG MẠI BẮC HÀ</h2>
        </div>
        <div className="row buttons-row">
          <a href="#" className="btn btn-about">Về BAK Group</a>
          <a href="#" className="btn btn-register">Đăng ký sử dụng dịch vụ</a>
        </div>
      </div>
      <div className="column column-right">
        <img
          src="/images/your-image.jpg" // Thay bằng đường dẫn tới ảnh đại diện của bạn
          alt="BachaGroup"
          className="representative-image"
        />
      </div>
    </div>
  );
};

export default Home;
